Strategy and Steps Dealing with Covid-19

0) The unique feature of the coronary disease facing humans this time is the existence of majority of asymptomatic people contagous and being the nature of "time bomb";

1) Therefore, the contradiction between crown disease and production is the contradiction between life and development - human beings must always choose life first;

2) Accordingly, before the epidemic is under control, there is no "excessive prevention – until one is absolutely sure of immunity;

3) Accordingly, everyone must be assumed to be a "potential virus carrier" - unless tested (clinical cases giving a time frame);

4) Accordingly, the more tests, the more known, therefore reducing mortality and maintaining production must be made only by those who have been tested;

5) Human living space is facing a sea of viruses that they are ignorant of. Detection control is an island on which human beings can survive and produce. The more detections, the larger the known territory in which humans are likely to survive. On the other hand, however, of the wider the ocean of unknown viruses facing humans. Always so.

Five specific steps for the government to respond to coronavirus
1) Everyone must take test, essential workers have test prority;
2) Only the tested can resume work;
3) Establish "immunization zone", prohibit non-tested individuals from entering;
4) Those who have not tested must not leave the house to wait for the test;
5) Establish a validity period for the test effective duration.
(The End)
